# Scheme:
#
# korok types:
# .meta.types[<TYPE>]:
#   name: string
#   icon: string
#
# korok regions:
# .meta.regions[<PREFIX>]:
#   name: string
#   count:
#     main: number
#     sky: number
#
# main korok data:
# .data[<ID>]:
#   type: string
#   move: arrayof [x, y, z] - movements.
#                single point for lift rock, confetti, etc
#                2 points for races, etc
#                more points for flowers, etc

  # Acorn in a Hole" -> AcornLog/AcornTree
  # Catch the Light" -> Light Catch
  # Flower Trail" -> Flower Chase (Movements)
  # Goal Ring (Race)" -> Race (Start/End)
  # Hanging Acorn" -> Acorn Hanging
  # Korok Friends" -> Friends (Start/End)
  # Land on Target" -> Target Landing (need check)
  # Moving Lights" -> Light Chase
  # Offering Plate" -> Offer Apple/Pepper/Banana/Durian/PalmFruit/Egg/Shield/?
  # Pinwheel Balloons" -> Balloon (Pinwheel)
  # Provide Shelter" -> Build Roof
  # Pull the Plug" -> Pull Plug
  # Puzzle Blocks" -> Block Puzzle
  # Repair Roof" -> Repair Roof
  # Ring the Bell" -> Ring Bell
  # Rock Lift" -> Lift Rock ////?
  # Rock Pattern" -> Rock Circle
  # Stationary Balloon" -> Balloon (Stationary)
  # Stationary Lights" -> Confetti
  # Through the Roof" -> Ascend (Start/Finish)
  # Touch the Target" -> Target Touch (need check)
